import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';


function Header() {
    return (
        <Navbar collapseOnSelect expand="lg" className="bg-body-tertiary mb-5 mt-4">
            <Container>
                <Navbar.Brand>React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto ms-5 d-flex gap-5">
                        <NavLink to='/' style={{ textDecoration: "none", color: "black" }}>Home</NavLink>
                        <NavLink to='/about' style={{ textDecoration: "none", color: "black" }}>About</NavLink>
                        <NavLink to='/contact' style={{ textDecoration: "none", color: "black" }}>Contact</NavLink>
                        <NavLink to='/products' style={{ textDecoration: "none", color: "black" }}>Products</NavLink>
                    </Nav>
                    <Nav>
                        <NavLink href="#deets">More deets</NavLink>
                        <NavLink eventKey={2} href="#memes">
                            Dank memes
                        </NavLink>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default Header;
